import { createAsyncThunk } from "@reduxjs/toolkit";
import Api from "../../Api";





//register skizb
export const register = createAsyncThunk('action/register', async(payload) => {
   const {data} = await Api.registration(payload);
   return data;
})



//login
export const login = createAsyncThunk('action/login', async(payload) => {
  const {data} = await Api.login(payload);
  return data;
})
//login verj
